signatures: >-
  executeAgentCommand(agentDirectoryPath:string, args:Array.<string>) :
  Promise.<string> - Executes a faqtiv CLI command in the specified agent
  directory. Resolves with the command's stdout output or rejects with an error
  if the command execution fails.


  fetchYamlApiSpec(apiUrl:string) : Promise.<Object> - Fetches the API spec from
  the given URL and parses it using Swagger-Parser. Resolves with a parsed API
  spec object or rejects with an error if the fetch or parse operation fails.
